import React from 'react';
import { BiAtom,BiBug,BiSun } from "react-icons/bi";

const Test1 = () => {
    return (
        <div>
            <h2 style={{fontSize : 50, color : 'skyblue'}}><BiAtom/></h2>
            <h2 style={{fontSize : 50, color : 'orange'}}><BiSun/></h2>
            <h2 style={{fontSize : 50, color : 'red'}}><BiBug/></h2>
        </div>
    );
};

export default Test1;
